var b="url",c="☆1_2新建库内费用-成本单.html",d="generationDate",e=new Date(1679621624771.01),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="currentTime",s="page",t="packageId",u="1f8378b18573420e95c8e31a605e8722",v="type",w="Axure:Page",x="☆1.2新建库内费用-成本单",y="notes",z="annotations",A="fn",B="1",C="ownerId",D="4a1a62fc2d04472e8b3a8f1b01d482b3",E="label",F="表单-供应商",G="说明",H="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">从供应商类型有“仓库”的供应商中选择</span></p>",I="是否必填",J="<p><span>√</span></p>",K="格式",L="<p><span>1. 下拉单选</span></p>",M="2",N="9b9ce584ed244b229a6b74aa620f5a81",O="表单-应用仓库",P="<ul><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#D9001B;\">未选择供应商，应用仓库下拉菜单为禁用状态，选择供应商后，变更为启用状态</span></li><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">根据供应商选择，下拉展示该供应商的启用状态的仓库，按仓库名称的拼音字母排序</span></li><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">仓库多选，判断</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#D9001B;\">计费币种是否相同</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">，如选择的多个仓库之间币种不同，提示“您选择的仓库的计费币种不统一，请重新选择”</span></li></ul>",Q="<p><span>2. 下拉多选</span></p>",R="3",S="4a6144d449364b9787e0536029748a07",T="表单-计费币种",U="<ul><li style=\"\"><span>默认显示为空</span></li><li style=\"\"><span>选择仓库后，立即显示仓库的币种</span></li><li style=\"\"><span>如果选择多个仓库币种不同，则立即红字显示‘</span><span style=\"font-family:'Microsoft YaHei UI', sans-serif;color:#D9001B;\">您选择的仓库的计费币种不唯一，请重新选择’</span></li></ul>",V="<p><span>-</span></p>",W="<p><span>7. 显示Label</span></p>",X="4",Y="e6e2b12bf6a84017bae50464653cee43",Z="表单-有效期",ba="<ul><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">有效期是无时区属性的规则日期，需要按照仓库所在时区换算确认是否生效</span></li><ul><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">例如生效日期是1月1日，当前北京时间1月1日08：00，对于德国utc+1是1月1日01:00该规则已经生效，但对于洛杉矶utc-8是12月31日：16:00，该规则并未生效</span></li></ul><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">新建库内费用的有效期开始和结束日期，仅支持填写‘&gt;账号所在时区的日期’</span></li></ul>",bb="<p><span>4. 日期区间</span></p>",bc="5",bd="45210f1ccf4d4261acd591c8bc38f220",be="Tab-业务类型",bf="<ul><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">通过tab的方式切换选择业务类型</span></li><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">目前仅{一件代发}一种业务类型</span></li></ul>",bg="6",bh="124cd507b76d4f899ad68ecc5e292a74",bi="按钮-添加费用",bj="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">点击弹窗，输入费用信息，具体请到以下page查看</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#0052D9;\">☆1.2.1第一步：费用默认样式</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#0052D9;\">☆1.2.2第二步：不同业务模式样式</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#0052D9;\">☆1.2.3第三步：计费规则模板</span></p>",bk="7",bl="4fe5fe3c6e8b4197bbca0d576f899b12",bm="列表-业务行为",bn="<ul><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">业务行为包含以下，默认排序按添加时间倒叙排序</span></li><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">第一次点击升序排序：入库→代发库存→代发出库→退货→退货库存→盘盈→盘盈库存→盘亏→通用</span></li><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">第二次点击降序排序</span></li><li style=\"\"><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">第三次点击恢复默认排序</span></li></ul>",bo="8",bp="b57c3eef9f5f4819bcf3dbf50f8a29d3",bq="列表-操作",br="<p><span>【编辑】</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;color:#333333;\">点击弹窗，修改费用信息，窗口逻辑参考【添加费用】弹窗说明</span></p><p><span>【删除】点击弹窗，提示是否确认删除费用，点击【确认】执行删除</span></p>",bs="9"